 # Como funciona a impressao na tela:
#		O espaco que o procesador reconhece como output, o DISPbeg, sera preenchido com o background ja no inicio.
#		A cada frame, vamos atualizar este buffer com os elementos que aparecem na tela, mas nao sem antes preencher com a parte especifica do bg os espacos que estiverem ocupados pelos elementos anteriores.
#		A tela e assim:
#		(pixel 000) (pixel 001) (pixel 002) ... (pixel 318) (pixel 319)
#		(pixel 320) (pixel 321)             ...             (pixel 639)
#		...
#		(pixel 76480)                       ...           (pixel 76799)
# Como saber quais elementos devem ser "apagados" do buffer:
#		O registrador s11 sera reservado EXCLUSIVAMENTE para guardar uma palavra de (ainda nao sei quantos) bits, tal que cada bit representa se um dado elemento (os crocodilos, o cipo, o escorpiao, ...) esta presente ou nao na tela.
#		O procedimento "clearsp" vai fazer uma mascara, bit por bit, para determinar se sera necessario pegar na memoria as coordenadas de um dado elemento e aplicar uma mascara do bg no buffer DISPbeg para cobrir o sprite antigo.
#		Dessa maneira nao sera necessario acessar a memoria para determinar quais elementos estao presentes na tela.
# LEMBRAR DE SEGUIR SEMPRE AS CONVENCOES QUANTO AO USO DE REGISTRADORES SALVOS!!!!
