M_SetEcall(exceptionHandling)	# Macro de SetEcall - no tem ainda na DE1-SoC
################################################################################# MAIN #################################################################################
main:
	li s11, 0
	li s8, 0
	li s7, 0
	
	call PrintBg

	call StartupScreen


	# inicia o Harry no estado caindo
	li t0, 0x40
	or s11, s11, t0
	# posicao inicial
	li s10, 23701
	# inicia a animacao
	addi s11, s11, 14

	or s11, s11, t0					# inicia o cipo com tan = 1
	li s9, -1						# necessario para o bom funcionamento do cipo
	li t0, 0x07D00000
	or s8, s8, t0					# pontuacao inicial
	li t0, 0x00008000
	or s8, s8, t0					# vida inicial
	li t0, 0x500
	or s7, s7, t0					# temporizador inicial
	
	j skip_test

	li t0, 0x02000000
	#or s11, s11, t0					# ativa o buraco
	li t0, MASKvine
	#or s11, s11, t0					# ativa o cipo
	li t0, 0x00C80000
	li t0, MASKladder
	#or s11, s11, t0					# coloca a escadinha
	li t0, MASKlake
	#or s11, s11, t0					# coloca o lago
		li t0, MASKdillon
		#or s11, s11, t0						# coloca os dillons (dependem do lago)
	li t0, MASKtreasure
	#or s11, s11, t0					# coloca o tesouro
	li t0, 0x400
	#or s8, s8, t0					# coloca 2 barris em tela
	li t0, MASKlescorpion
	or s7, s7, t0
	li t0, 0x02600000
	or s7, s7, t0					# inicia o escorpiao no x = 152

	skip_test:
	li t0, MASKladder
	or s11, s11, t0
	# indica um barril
	li t0, 0x200
	or s8, s8, t0
	# indica parede na direita
	li t0, 0x8000
	or s7, s7, t0
		la a0, Wall
		li a1, 14
		li a2, 44
		li a3, 59793
		call PrintSp

	# encontra o tempo que deve ser descontado ao calcular o timer
	li a7, 130
	M_Ecall
	mv s6, a0

	main_loop:

	# a funcao ecall para sleep trava muito o jogo
	call Sleep

	call FrameStepper

	li t0, 0x80000000				# 2^31 -> vamos aplicar uma mascara para achar o ultimo bit
	and t0, t0, s11
	beq t0, x0, main_loop
	
	li a7, 10
	M_Ecall
	
################################################################################# FUNCOES #################################################################################
Sleep:
	li t0, 50000
	li t1, -1
	sleep_loop:
	addi t1, t1, 1
	bne t0, t1, sleep_loop
	ret
# Coloca na tela algum sprite
# Antes:
#	a0 = endereco na RAM do sprite a ser inserido na tela
#	a1 = largura, em pixels
#	a2 = altura, em pixels
#	a3 = endereco na tela onde o sprite deve ser impresso (ainda sem adicionar o DISPbeg)
# Depois:
#	a0 = 1 se sair normalmente, -1 caso as coordenadas sejam invalidas
PrintSp:												# print sprite
	addi sp, sp, -12
	sw a0, 4(sp)
	sw t0, 8(sp)
	sw t3, 12(sp)

	li t1, 320
	rem t0, a3, t1
	sub t1, t1, t0			# t1 = distancia ate a extremidade direita da tela

	li t2, DISPbeg
	add a3, a3, t2				# a3 = endereco onde o sprite vai ser impresso
	li t2, 124					# t2 = cor do pixel invisivel
	
	li t5, 0					# t5 -> contador vertical
	li t6, 0					# t6 -> contador horizontal
	li t3, 320
	sub t3, t3, a1				# t3 = quantidade de pixels necessarios para descer uma linha

	printsp_pixel:
		# checa se o endereco destino desse pixel esta escondido
			# encontra a posicao do pixel na tela
			li t0, DISPbeg
			sub t4, a3, t0

			li t0, 52160
			blt t4, t0, pixel_clear
			li t0, 59520
			bge t4, t0, pixel_clear
			li t0, 52250
			blt t4, t0, invis_pixel
			li t0, 52370
			blt t4, t0, pixel_clear
			li t0, 52580
			blt t4, t0, invis_pixel
			li t0, 52680
			blt t4, t0, pixel_clear
			li t0, 52982
			blt t4, t0, pixel_clear
			li t0, 53260
			blt t4, t0, invis_pixel
			li t0, 53281
			blt t4, t0, pixel_clear
			j invis_pixel
			pixel_clear:
		# end_hidden
		lb t0, 0(a0)				# pega o byte da RAM
		beq t0, t2, invis_pixel		# ignora a cor invisivel (um verde ai)
		bge t6, t1, overflow_pixel	# verifica se o contador e igual ou maior a distancia ate a borda direita --- indicando se o sprite ultrapassou o limite da tela
		sb t0, 0(a3)				# coloca o byte no endereco do buffer
	invis_pixel:
		addi a0, a0, 1				# vai para o proximo byte da RAM
		addi a3, a3, 1				# vai para o proximo pixel do display
		addi t6, t6, 1				# incrementa o contador horizontal
		bne t6, a1, printsp_pixel	# determina se continua na mesma linha
		
		add a3, a3, t3				# pula uma linha
		li t6, 0					# reseta o contador horizontal
		addi t5, t5, 1				# incrementa o contador vertical
		bne t5, a2, printsp_pixel	# determina se ja printou todas as linhas
		li a0, 1

		lw t3, 12(sp)
		lw t0, 8(sp)
		lw a0, 4(sp)
		addi sp, sp, 12
		ret

	overflow_pixel:
		sub a0, a0, t6
		add a0, a0, a1
		sub a3, a3, t6
		addi a3, a3, 320
		li t6, 0					# reseta o contador horizontal
		addi t5, t5, 1				# incrementa o contador vertical
		bne t5, a2, printsp_pixel	# determina se ja printou todas as linhas
		li a0, 1

		lw t3, 12(sp)
		lw t0, 8(sp)
		lw a0, 4(sp)
		addi sp, sp, 12
		ret
#end_printsp

# Apaga um sprite da tela
# Antes:
#	a0 = endereco do sprite na tela (ainda sem contar o DISPbeg)
#	a1 = largura, em pixels
#	a2 = altura, em pixels
EraseSp:
	addi sp, sp, -12
	sw a0, 4(sp)
	sw t0, 8(sp)
	sw t3, 12(sp)

	# Vamos achar a distancia do sprite ate o fim da tela: vamos tornar o enderco negativo e somar a largura da tela ate que o montante se torne positivo, que sera a distancia
		sub t1, x0, a0
		erase_finddist:
		addi t1, t1, 320
		blt t1, x0, erase_finddist	# t1 = distancia ate a extremidade direita da tela
	la t0, BG
	add t4, a0, t0				# t4 = endereco correspondente do plano de fundo
	li t0, DISPbeg
	add a0, a0, t0				# a0 = endereco real do sprite
	
	li t5, 0					# t5 -> contador vertical
	li t6, 0					# t6 -> contador horizontal
	li t3, 320
	sub t3, t3, a1				# t3 = quantidade de pixels necessarios para descer uma linha

	erase_printsp_pixel:
	lb t0, 0(t4)				# pega o byte da RAM
	sb t0, 0(a0)				# coloca o byte no endereco do buffer

	addi a0, a0, 1				# vai para o proximo byte da RAM
	addi t4, t4, 1				# vai para o proximo pixel do display
	addi t6, t6, 1				# incrementa o contador horizontal
	bne t6, a1, erase_printsp_pixel	# determina se continua na mesma linha
	
	add t4, t4, t3				# pula uma linha
	add a0, a0, t3
	li t6, 0					# reseta o contador horizontal
	addi t5, t5, 1				# incrementa o contador vertical
	bne t5, a2, erase_printsp_pixel	# determina se ja printou todas as linhas
	li a0, 1

	lw t3, 12(sp)
	lw t0, 8(sp)
	lw a0, 4(sp)
	addi sp, sp, 12
	ret
#end_erasesp

# Printa na tela o background
# Null argumentos, Null retorno
PrintBg:
	addi sp, sp, -4
	sw a0, 4(sp)

	la t2, BG 					# t2 = endereco na RAM do BG
	li a0, DISPbeg					# a0 = endereco destino na tela
	li t5, 0					# t5 -> contador
	li t1, 76800				# t1 = tamanho da tela
	printbg_pixel:
		lw t0, 0(t2)					# pega o word da RAM
		sw t0, 0(a0)					# coloca o word no endereco do buffer
		addi t2, t2, 4					# vai para o proximo byte da RAM
		addi a0, a0, 4					# vai para o proximo pixel do display
		addi t5, t5, 4					# incrementa o contador
		bne t5, t1, printbg_pixel	# determina se ja finalizou		

		lw a0, 4(sp)
		addi sp, sp, 4
		ret
#end_printbg

# Checa se ha algum comando novo do jogador
# Nao recebe argumentos
# Depois:
# 	a0 = InputNovo? valorInserido : 0
Polling:
	li t0, KEYBbeg
	lbu a0, 0(t0)
	andi a0, a0, 1
	beq a0, x0, end_polling
	lbu a0, 4(t0)
	end_polling:
	ret
#end_polling

# faz a troca de fase, e retorna para o inicio de FrameStepper
# Antes:
# 	a0 = estagio alvo
SwitchStage:
	call PrintBg
	li t0, MASKstrip_s11
	and s11, s11, t0
	li t0, MASKstrip_s8
	and s8, s8, t0
	li t0, MASKstrip_s7
	and s7, s7, t0

	beqz a0, stage0
	li t0, 2
	blt a0, t0, stage1
	beq a0, t0, stage2
	li t0, 4
	blt a0, t0, stage3
	beq a0, t0, stage4
	li t0, 6
	blt a0, t0, stage5
	beq a0, t0, stage6
	li t0, 8
	blt a0, t0, stage7
	beq a0, t0, stage8
	j stage9
	stage0:
		li t0, MASKladder
		or s11, s11, t0
		# indica um barril
		li t0, 0x200
		or s8, s8, t0
		# indica parede na direita
		li t0, 0x8000
		or s7, s7, t0
			la a0, Wall
			li a1, 14
			li a2, 44
			li a3, 59793
			call PrintSp
		j begin_fs
	stage1:
		li t0, MASKhole
		or s11, s11, t0
		# indica dois barris
		li t0, 0x400
		or s8, s8, t0
		# indica parede na esquerda
		li t0, 0x10000
		or s7, s7, t0
			la a0, Wall
			li a1, 14
			li a2, 44
			li a3, 59548
			call PrintSp
		j begin_fs
	stage2:
		li t0, MASKhole
		or s11, s11, t0
		li t0, MASKvine
		or s11, s11, t0
