# Realiza a manuteno dos ciclos de frames e realiza a chamada das funcoes de impressao em tela
# 
FrameStepper:							# FrameStepper = fs
	addi sp, sp, -4
	sw ra, 4(sp)
	begin_fs:
	#timer
		li a7, 130
		M_Ecall
		# encontra o tempo que se passou desde o inicio da execucao da main, em milissegundos
		sub t0, a0, s6

		li t1, 1000
		div t1, t0, t1
		beqz t1, end_timer
		# atualiza o offset
		add s6, s6, t0
		# desconta um segundo do contador
		li t0, MASKseconds
		and t0, s7, t0
		# se os segundos estiverem zerados, puxa do minuto
		bnez t0, timer_discount_simple
			li t0, MASKminutes
			and t0, s7, t0
			# se os minutos estiverem zerados tambem, fim de jogo
			bnez t0, timer_continue
				li t0, 0x80000000
				or s11, s11, t0
				j end_timer
			timer_continue:
				# tirar 5 e o mesmo que tirar um minuto e somar 59 segundos
				addi s7, s7, -5
				j end_timer
			timer_discount_simple:
				addi s7, s7, -1
	end_timer:

	#header
		li a0, 3207
		li a1, 63
		li a2, 20
		call EraseSp

		# score
		li t0, MASKscore
		and t0, s8, t0
		srli a0, t0, 16
		li a1, 30
		li a2, 10
		li a3, 0x1AFF
		li a7, 101
		M_Ecall

		# timer
		li t0, MASKseconds
		and a0, s7, t0
		li a1, 54
		li a2, 22
		li a3, 0x1AFF
		li a7, 101
		M_Ecall
		li t0, MASKminutes
		and t0, s7, t0
		.eqv MASKlives 0x0000C000
		srli a0, t0, 6
		li a1, 30
		li a2, 22
		li a3, 0x1AFF
		li a7, 101
		M_Ecall
		li a0, 58
		li a1, 46
		li a2, 22
		li a3, 0x1AFF
		li a7, 111
		M_Ecall

		# lives
		li t0, MASKlives
		and t0, s8, t0
		beqz t0, end_header
		srli t0, t0, 14
		li t1, 1
		beq t1, t0, header_1_life

		li a0, 124
		li a1, 7
		li a2, 22
		li a3, 0x1AFF
		li a7, 111
		M_Ecall
		header_1_life:
		li a0, 124
		li a1, 15
		li a2, 22
		li a3, 0x1AFF
		li a7, 111
		M_Ecall
	end_header:

	#counter
		# atualiza o contador (bits 26-30)
		li t0, MASKcounter
		bge s11, t0, counter_reset					# se s11 for maior que esse valor, certamente o contador esta no estado 11111
		li t0, 0x04000000
		add s11, s11, t0
		j fs_counter_end
		counter_reset:
		li t0, 0x03FFFFFF
		and s11, s11, t0					# zera o contador
	fs_counter_end:

	#lescorpion
		# checa se esta presente
		li t0, MASKlescorpion
		and t0, s7, t0
		beqz t0, fs_lescorpion_end

		# apaga o sprite anterior
		li t0, MASKlescorpion_x
		and t3, s7, t0
		srli t3, t3, 18
		li t0, 68800
		add a0, t3, t0
		li a1, 16
		li a2, 11
		call EraseSp

		# faz a movimentacao do animal
		li t0, 320
		rem t2, s10, t0			# t2 = x(harry)
		beq t3, t2, fs_lescorpion_print_r
		sub t0, t2, t3
		bge t0, x0, fs_lescorpion_r
			addi t2, t3, -2
			# checa se tem uma parede na frente
			li t0, 0x00010000
			and t0, s7, t0
			beqz t0, fs_lescorpion_l_skip_wall
				# aqui checa colisao com a parede
				li t0, 42
				blt t2, t0, fs_lescorpion_print_l
			fs_lescorpion_l_skip_wall:
			# aqui atualiza a coordenada do escorpiao
			mv t3, t2
			li t0, 0x00080000
			sub s7, s7, t0
			fs_lescorpion_print_l:
			# aqui printa ele
			li t0, 0x04000000
			and t0, s11, t0
			beqz t0, fs_lescorpion_print_l_0
				la a0, Lescorpion2_l
				li a1, 16
				li a2, 11
				li t0, 68800
				add a3, t3, t0
				call PrintSp
			j fs_lescorpion_check
			fs_lescorpion_print_l_0:
				la a0, Lescorpion1_l
				li a1, 16
				li a2, 11
				li t0, 68800
				add a3, t3, t0
				call PrintSp
		j fs_lescorpion_check
		fs_lescorpion_r:
			addi t2, t3, 2
			# checa se tem uma parede na frente
			li t0, 0x00008000
			and t0, s7, t0
			beqz t0, fs_lescorpion_r_skip_wall
				# aqui checa colisao com a parede
				li t0, 254
				blt t0, t2, fs_lescorpion_print_l
			fs_lescorpion_r_skip_wall:
			# aqui atualiza a coordenada do escorpiao
			mv t3, t2
			li t0, 0x00080000
			add s7, s7, t0
			fs_lescorpion_print_r:
			# aqui printa ele
			li t0, 0x04000000
			and t0, s11, t0
			beqz t0, fs_lescorpion_print_r_0
				la a0, Lescorpion2_r
				li a1, 16
				li a2, 11
				li t0, 68800
				add a3, t3, t0
				call PrintSp
			j fs_lescorpion_check
			fs_lescorpion_print_r_0:
				la a0, Lescorpion1_r
				li a1, 16
				li a2, 11
				li t0, 68800
				add a3, t3, t0
				call PrintSp

		fs_lescorpion_check:
			#checa o estado de Harry
			li t0, MASKharry_state
			and t0, s11, t0
			li t1, 0xC0
			beq t1, t0, fs_lescorpion_end

			li t0, 64640
			blt s10, t0, fs_lescorpion_end
			li t0, 320
			rem t2, s10, t0			# t2 = x(harry)
			addi t0, t3, -6
			blt t2, t0, fs_lescorpion_end
			addi t0, t3, 4
			blt t0, t2, fs_lescorpion_end
			# aqui harry toma picada
			# atualiza o estado de Harry
			li t0, 0xFFFFE63F
			and s11, s11, t0
			li t0, 0x000000C0
			or s11, s11, t0
	fs_lescorpion_end:

	#vine
		# checa se o cipo esta presente
		li t0, MASKvine
		and t0, t0, s11
		beqz t0, fs_vine_end
		# encontra a tangente (lembrando que ela esta multiplicada por 100)
		li t0, MASKtan
		and a0, s11, t0
		srli a0, a0, 17
		# se o 8o bit desse valor for 1, ele e negativo, e precisamos extender o sinal
		li t0, 128
		blt a0, t0, fs_vine_skip_sign_extension
			li t0, 0xFFFFFF00
			or a0, a0, t0
		fs_vine_skip_sign_extension:
		call EraseVine
		# encontra para qual lado o cipo esta indo
		li t0, MASKvine_dir
		and t0, s11, t0
		bne t0, x0, fs_vine_left
		# se tan>100 esta na hora de trocar o sentido
		li t0, 100
		bge a0, t0, fs_vine_left
		fs_vine_right:
		# se o programa veio pra ca pq a tan<-100, devemos atualizar o valor da bandeira
		li t0, 0xFFFEFFFF
		and s11, s11, t0
		# atualiza o valor da tangente
		addi a0, a0, TANdisp
		# atualiza o s11
		li t0, 0xFE01FFFF
		and s11, s11, t0
		slli t0, a0, 17
		# e necessario aplicar uma mascara nesse resultado, pois ele veio com sinal extendido
		li t1, MASKtan
		and t0, t0, t1
		or s11, s11, t0
		j fs_vine_end
		fs_vine_left:
		li t0, -100
		bge t0, a0, fs_vine_right
		# se o programa veio pra ca pq a tan>100, devemos atualizar o valor da bandeira
		li t0, MASKvine_dir
		or s11, s11, t0
		# atualiza o valor da tangente
		addi a0, a0, -TANdisp
		# atualiza o s11
		li t0, 0xFE01FFFF
		and s11, s11, t0
		slli t0, a0, 17
		# e necessario aplicar uma mascara nesse resultado, pois ele veio com sinal extendido
		li t1, MASKtan
		and t0, t0, t1
		or s11, s11, t0
	fs_vine_end:

	#barrel
		# primeiro checamos se ha algum barril, e quantos
		li t3, MASKbarrel_qtt		# t3 = qtd de barris
		and t3, s8, t3
		beqz t3, fs_barrel_end
		srli t3, t3, 9


		li t2, MASKbarrel_x
		and t2, s8, t2				# t2 = coord x do barril lider
		# apaga os barris
			li t0, 48960
			add a0, t0, t2
			li a1, 12
			li a2, 17				# um a mais para apagar a parte em q ele desce
			call EraseSp
			li t0, 2
			blt t0, t3, fs_barrel_3
			blt t3, t0, fs_barrel_disp
				addi a0, a0, 40
				li t0, 49280
				blt a0, t0, fs_barrel_2_ok
				addi a0, a0, -320
				fs_barrel_2_ok:
				call EraseSp
			j fs_barrel_disp
			fs_barrel_3:
				addi a0, a0, 100
				li t0, 49280
				blt a0, t0, fs_barrel_3_ok1
				addi a0, a0, -320
				fs_barrel_3_ok1:
				call EraseSp
				addi a0, a0, 100
				li t0, 49280
				blt a0, t0, fs_barrel_3_ok2
				addi a0, a0, -320
				fs_barrel_3_ok2:
				call EraseSp
		fs_barrel_disp:
		# checamos se apos o deslocamento a coordenada nao se torna negativa
		li t0, BARRELdisp
		blt t2, t0, fs_barrel_neg
		addi s8, s8, -BARRELdisp
		j fs_barrel_end
		fs_barrel_neg:
		li t1, 320
		sub t0, t1, t0
		add s8, s8, t0
	fs_barrel_end:

	j end_sk
	#special_keys
		j_0:
			li t0, 0xFFFFE63F
			and s11, s11, t0
