	#fs_harry
		call Polling 							# descobre se o jogador enviou um comando para o personagem se mover
		# aqui checa se o jogador quer fechar o jogo
		li t0, 27
		beq a0, t0, player_end_game	# case 'ESC'
		# checa por teclas especiais
			li t0, 48
			beq t0, a0, j_0 			# case '0'
			li t0, 49
			beq t0, a0, j_1 			# case '1'
			li t0, 50
