		beq t4, t0, sinking

		# aqui deve checar se o harry esta numa animacao de pulo, na qual ele deve permanecer no evento do pulo ate pousar novamente ou agarrar a um cipo
		andi t4, s11, MASKharry_sprite_state
		li t0, 12
		bge t4, t0, jumping
		# switch(a0)
