				# achando H^2
					addi t1, s10, 8					# encontramos o pixel que fica na ponta da cabeca do harry
					li t0, 18240
					sub t1, t1, t0					# encontramos a posicao desse pixel relativa a raiz do cipo, sem contar a coordenada x
					li t0, 320
					div t2, t1, t0					# t2 = y
					rem t3, t1, t0					
					addi t3, t3, -150				# t3 = x
					mul t4, t2, t2					# t4 = y^2
					mul t5, t3, t3					# t5 = x^2
					add a1, t4, t5					# a1 = y^2 + x^2 = H^2
