# realiza a queda inicial do personagem
HarryFalls:
	# atualiza o estado de Harry
	li t0, 0xFFFFFE3F
	and s11, s11, t0
	li t0, 0x00000040
	or s11, s11, t0
	# descobre qual era o estado do personagem ao cair no buraco
	andi t0, s11, MASKharry_sprite_state
	beqz t0, hf_r_s
	li t1, 6
	blt t0, t1, hf_r_d
	beq t0, t1, hf_l_s
	li t1, 12
	blt t0, t1, hf_l_d
	beq t0, t1, hf_r_d
	li t1, 14
	blt t0, t1, hf_l_d
	beq t0, t1, hf_r_s
	j hf_l_s
	hf_l_d:
		# indica caindo para a esquerda
		li t0, 0xFFFFFFF0
		and s11, s11, t0
		addi s11, s11, 13
		li t0, 2233
		add s10, s10, t0
	ret
	hf_r_s:
		# indica caindo para a esquerda
		li t0, 0xFFFFFFF0
		and s11, s11, t0
		addi s11, s11, 14
		li t0, 2240
		add s10, s10, t0
	ret
	hf_r_d:
		# indica caindo para a esquerda
		li t0, 0xFFFFFFF0
		and s11, s11, t0
		addi s11, s11, 12
		li t0, 2247
		add s10, s10, t0
	ret
	hf_l_s:
		# indica caindo para a esquerda
		li t0, 0xFFFFFFF0
		and s11, s11, t0
		addi s11, s11, 15
		li t0, 2240
		add s10, s10, t0
	ret
#end_hf

# encaixa harry num movimento que acompanha o do cipo
# Antes:
# 	a0 = tan do cipo
# 	a1 = distancia do Harry ate a raiz do cipo, ao quadrado
# Depois:
#	s10 = posicao ajusatada ao cipo
# 	s11 = estado correspondente a agarrando o cipo
# 	a0 = lixo
HarryGripsVine:
	addi sp, sp, -4
	sw ra, 4(sp)

	# atualiza o estado de Harry
	li t0, 0xFFFFFE3F
	and s11, s11, t0
	li t0, 0x00000080
	or s11, s11, t0
	# agora ajustamos a posicao de Harry ao cipo
	# de acordo com a formula:
		mv t4, a0					# t4 = a
		mul t2, a0, a0				# t2 = a^2
		mul a0, t2, a1				# H^2 * a^2
		li t0, 10000
		add t3, t2, t0				# a^2 + 100^2
		div a0, a0, t3
		call Sqrt
		bge t4, x0, hgv_pos
		sub a0, x0, a0
		hgv_pos:
		addi t2, a0, 150			# t2 = nova coordenada x
		addi t2, t2, -5
		li t0, 10000
		mul a0, t0, a1				# 100^2 * H^2
		div a0, a0, t3
		call Sqrt
		addi t0, a0, 57				# nova coordenada y
		li t1, 135
		blt t0, t1, hgv_y_ok
		li t0, 135
		hgv_y_ok:
		li a0, 320
		mul t0, t0, a0
		add s10, t0, t2

		li t0 100
		bne t4, t0, hgv_next
		bge s9, x0, hgv_read
		mv s9, s10
		j hgv_next
		hgv_read:
		mv s10, s9
		hgv_next:

	mv a0, t4
	lw ra, 4(sp)
	addi sp, sp, 4
	ret
#end_hgv

# Imprime na tela o cipo
# Antes:
# 	a0 = tangente do angulo do cipo
PrintVine:
	# primeiro encontramos a altura do triangulo que e formado pelo cipo, para saber quando parar as iteracoes
		mul t0, a0, a0
		li t1, 10000
		add t0, t0, t1
		li t1, VINElength
		mul t1, t1, t1
		li t2, 10000
		mul t1, t1, t2
		div t4, t1, t0				# t4 = valor limite ao quadrado de t2
	# fim
	li t1, DISPbeg
	li t0, 18390
	add t1, t1, t0					# t1 = endereco da raiz do cipo
	li t6, 0x5c						# t6 = cor do cipo
	li t2, 0						# t2 = coordenada y
	# encontra em qual quadrante se encontra o cipo
		blt a0, x0, pv_neg
		beq a0, x0, pv_zero
	# fim

	li t3, 0						# t3 = coordenada x
	pv_pos_print:
	add t0, t1, t3
	sb t6, 0(t0)
	addi t1, t1, 320					# a coordenada y sempre incrementa de 1 em 1
	addi t2, t2, 1						# incrementa o registro da coordenada
	mul t0, t2, t2
	bge t0, t4, pv_end
	# decide o novo valor da coordenada x
	# se a tangente das coordenadas y atual e x = x(atual) + 1 for igual ou menor a tangente providenciada, sabemos que e hora de incrementar x
	# lembrando que nos calculos estamos utilizando x * 100
	li t0, 100
	mul t0, t3, t0
	addi t0, t0, 100
	div t0, t0, t2
	blt a0, t0, pv_pos_print
	addi t3, t3, 1
	j pv_pos_print

	pv_neg:
	li t3, 0						# t3 = coordenada x
	pv_neg_print:
	add t0, t1, t3
	sb t6, 0(t0)
	addi t1, t1, 320					# a coordenada y sempre incrementa de 1 em 1
	addi t2, t2, 1						# incrementa o registro da coordenada
	mul t0, t2, t2
	bge t0, t4, pv_end
	# decide o novo valor da coordenada x
	# se a tangente (em modulo) das coordenadas y atual e x = x(atual) + 1 for igual ou menor a tangente providenciada (em modulo), sabemos que e hora de incrementar x
	# lembrando que nos calculos estamos utilizando x * 100
	li t0, 100
	mul t0, t3, t0
	addi t0, t0, -100
	div t0, t0, t2
	blt t0, a0, pv_neg_print
	addi t3, t3, -1
	j pv_neg_print

	pv_zero:
	li t0, VINElength
	pv_zero_print:
	sb t6, 0(t1)
	addi t1, t1, 320					# a coordenada y sempre incrementa de 1 em 1
	addi t2, t2, 1						# incrementa o registro da coordenada
	bge t2, t0, pv_end
	j pv_zero_print

	pv_end:
	ret
#end_pv

# Apaga da tela o cipo
# Antes:
# 	a0 = tangente do angulo do cipo
EraseVine:
	# primeiro encontramos a altura do triangulo que e formado pelo cipo, para saber quando parar as iteracoes
		mul t0, a0, a0
		li t1, 10000
		add t0, t0, t1
		li t1, VINElength
		mul t1, t1, t1
		li t2, 10000
		mul t1, t1, t2
		div t4, t1, t0				# t4 = valor limite ao quadrado de t2
	# fim
	li t1, DISPbeg
	li t0, 18390
	add t1, t1, t0					# t1 = endereco da raiz do cipo
	la t2, BG
	add t6, t2, t0					# t6 = endereco correspondente no background
	li t2, 0						# t2 = coordenada y
	# encontra em qual quadrante se encontra o cipo
		blt a0, x0, ev_neg
		beq a0, x0, ev_zero
	# fim

	li t3, 0						# t3 = coordenada x
	ev_pos_print:
	add t0, t1, t3
	add a1, t6, t3
	lb t5, 0(a1)
	sb t5, 0(t0)
	addi t1, t1, 320					# a coordenada y sempre incrementa de 1 em 1
	addi t6, t6, 320					# a coordenada y sempre incrementa de 1 em 1
	addi t2, t2, 1						# incrementa o registro da coordenada
	mul t0, t2, t2
	bge t0, t4, ev_end
	# decide o novo valor da coordenada x
	# se a tangente das coordenadas y atual e x = x(atual) + 1 for igual ou menor a tangente providenciada, sabemos que e hora de incrementar x
	# lembrando que nos calculos estamos utilizando x * 100
	li t0, 100
	mul t0, t3, t0
	addi t0, t0, 100
	div t0, t0, t2
	blt a0, t0, ev_pos_print
	addi t3, t3, 1
	j ev_pos_print

	ev_neg:
	li t3, 0						# t3 = coordenada x
	ev_neg_print:
	add t0, t1, t3
	add a1, t6, t3
	lb t5, 0(a1)
	sb t5, 0(t0)
	addi t1, t1, 320					# a coordenada y sempre incrementa de 1 em 1
	addi t6, t6, 320					# a coordenada y sempre incrementa de 1 em 1
	addi t2, t2, 1						# incrementa o registro da coordenada
	mul t0, t2, t2
	bge t0, t4, ev_end
	# decide o novo valor da coordenada x
	# se a tangente (em modulo) das coordenadas y atual e x = x(atual) + 1 for igual ou menor a tangente providenciada (em modulo), sabemos que e hora de incrementar x
	# lembrando que nos calculos estamos utilizando x * 100
	li t0, 100
	mul t0, t3, t0
	addi t0, t0, -100
	div t0, t0, t2
	blt t0, a0, ev_neg_print
	addi t3, t3, -1
	j ev_neg_print

	ev_zero:
	li t0, VINElength
	ev_zero_print:
	lb t5, 0(t6)
	sb t5, 0(t1)
	addi t1, t1, 320					# a coordenada y sempre incrementa de 1 em 1
	addi t6, t6, 320					# a coordenada y sempre incrementa de 1 em 1
	addi t2, t2, 1						# incrementa o registro da coordenada
	bge t2, t0, ev_end
	j ev_zero_print

	ev_end:
	ret
#end_ev

# Coloca na tela um barril
# Antes:
#	a0 = endereco na tela onde o sprite deve ser impresso (ainda sem adicionar o DISPbeg)
# Depois:
#	a0 = 1 se sair normalmente, -1 caso as coordenadas sejam invalidas
PrintBarrel:
	addi sp, sp, -16
	sw a0, 4(sp)
	sw t0, 8(sp)
	sw t3, 12(sp)
	sw t2, 16(sp)
	
	li a1, 12					# a1 = largura
	li a2, 15					# a2 = altura
	li t0, 0x04000000

	# vamos determinar as variacoes do sprite
	and t0, s11, t0				# pega o primeiro bit do contador
	beqz t0, PrintBarrel_m
		la a3, Barrel
		li t0, 0x08000000
		and t0, s11, t0			# pega o segundo bit do contador
		beqz t0, PrintBarrel_go
		addi a0, a0, 320		# imprime o barril um pixel abaixo
	j PrintBarrel_go
	PrintBarrel_m:
	la a3, Barrel_m
	PrintBarrel_go:

	# Vamos achar a distancia do sprite ate o fim da tela: vamos tornar o enderco negativo e somar a largura da tela ate que o montante se torne positivo, que sera a distancia
		sub t1, x0, a0
		barrel_finddist:
		addi t1, t1, 320
		blt t1, x0, barrel_finddist	# t1 = distancia ate a extremidade direita da tela
	li t2, DISPbeg
	add a0, a0, t2				# a0 = endereco onde o sprite vai ser impresso
	li t2, 124					# t2 = cor do pixel invisivel
	
	li t5, 0					# t5 -> contador vertical
	li t6, 0					# t6 -> contador horizontal
	li t3, 320
	sub t3, t3, a1				# t3 = quantidade de pixels necessarios para descer uma linha

	barrel_printsp_pixel:
		lb t0, 0(a3)				# pega o byte da RAM
		beq t0, t2, barrel_invis_pixel		# ignora a cor invisivel (um verde ai)
		bge t6, t1, barrel_overflow_pixel	# verifica se o contador e igual ou maior a distancia ate a borda direita --- indicando se o sprite ultrapassou o limite da tela
		sb t0, 0(a0)				# coloca o byte no endereco do buffer
	barrel_invis_pixel:
		addi a3, a3, 1				# vai para o proximo byte da RAM
		addi a0, a0, 1				# vai para o proximo pixel do display
		addi t6, t6, 1				# incrementa o contador horizontal
		bne t6, a1, barrel_printsp_pixel	# determina se continua na mesma linha
		
		add a0, a0, t3				# pula uma linha
		li t6, 0					# reseta o contador horizontal
		addi t5, t5, 1				# incrementa o contador vertical
		blt t5, a2, barrel_printsp_pixel	# determina se ja printou todas as linhas

		lw a0, 4(sp)
		lw t0, 8(sp)
		lw t3, 12(sp)
		lw t2, 16(sp)
		addi sp, sp, 16
		ret

	barrel_overflow_pixel:
		sb t0, -320(a0)				# coloca o byte no endereco do buffer um pixel acima
		j barrel_invis_pixel
#end_printsp

PrintLake:												# print sprite
	li a3, 50333
	la a0, Hole2
	li a1, 113
	li a2, 10
	# Vamos achar a distancia do sprite ate o fim da tela: vamos tornar o enderco negativo e somar a largura da tela ate que o montante se torne positivo, que sera a distancia
		sub t1, x0, a3
		lake_finddist:
		addi t1, t1, 320
		blt t1, x0, lake_finddist	# t1 = distancia ate a extremidade direita da tela
	li t2, DISPbeg
	add a3, a3, t2				# a3 = endereco onde o sprite vai ser impresso
	li t2, 124					# t2 = cor do pixel invisivel
	
	li t5, 0					# t5 -> contador vertical
	li t6, 0					# t6 -> contador horizontal
	li t3, 320
	sub t3, t3, a1				# t3 = quantidade de pixels necessarios para descer uma linha

	print_lake_pixel:
		lb t0, 0(a0)				# pega o byte da RAM
		beq t0, t2, lake_invis_pixel		# ignora a cor invisivel (um verde ai)
		li t0, 99
		sb t0, 0(a3)				# coloca o byte no endereco do buffer
	lake_invis_pixel:
		addi a0, a0, 1				# vai para o proximo byte da RAM
		addi a3, a3, 1				# vai para o proximo pixel do display
		addi t6, t6, 1				# incrementa o contador horizontal
		bne t6, a1, print_lake_pixel	# determina se continua na mesma linha
		
		add a3, a3, t3				# pula uma linha
		li t6, 0					# reseta o contador horizontal
		addi t5, t5, 1				# incrementa o contador vertical
		bne t5, a2, print_lake_pixel	# determina se ja printou todas as linhas
		li a0, 1
		ret
#end_print_lake

StartupScreen:
	addi sp, sp, -4
	sw ra, 4(sp)

	la a0, Title
	li a1, 178
	li a2, 40
	li a3, 56340
	call PrintSpNoFucks

	startup_loop:
	call Sleep
	#dillons_erase
		# se os bits antes do que indica o estado dorem 0, indica que trocou de estado no ultimo ciclo
		li t0, 0x1C000000
		and t0, s11, t0
		bnez t0, dillons_skip_erase
			li a1, 16
			li a2, 9
			li a0, 49398
			call EraseSp
			li a0, 49440
			call EraseSp
	dillons_skip_erase:
	call PrintLake
	#dillons_print
		# o quarto bit indica o estado dos dillons
		li t0, 0x20000000
		and t0, s11, t0
		bnez t0, dillons_co
			la a0, DillonO
			li a1, 16
			li a2, 9
			li a3, 49398
			call PrintSp
			la a0, Dillon
			li a1, 16
			li a2, 9
			li a3, 49440
			call PrintSp
		j dillons_end
		dillons_co:
			la a0, Dillon
			li a1, 16
			li a2, 9
			li a3, 49398
			call PrintSp
			la a0, DillonO
			li a1, 16
			li a2, 9
			li a3, 49440
			call PrintSp
	dillons_end:

	#startup_counter
		# atualiza o contador (bits 26-30)
		li t0, MASKcounter
		bge s11, t0, startup_counter_reset					# se s11 for maior que esse valor, certamente o contador esta no estado 11111
		li t0, 0x04000000
		add s11, s11, t0
		j startup_counter_end
		startup_counter_reset:
		li t0, 0x03FFFFFF
		and s11, s11, t0					# zera o contador
	startup_counter_end:

	li t0, 0x10000000
	and t0, s11, t0
	beqz t0, startup_erase

	la a0, StartupMessage
	li a1, 82
	li a2, 21
	li a3, 0x1AFF
	li a7, 104
	M_Ecall
	j startup_loop
	startup_erase:
	li a0, 6802
	li a1, 168
	li a2, 8
	call EraseSp

	call Polling
	bnez a0, startup_end

	j startup_loop

	startup_end:

	li a0, 6802
	li a1, 168
	li a2, 8
	call EraseSp
	li a0, 49373
	li a1, 113
	li a2, 13
	call EraseSp
	li a0, 56340
	li a1, 178
	li a2, 40
	call EraseSp

	lw ra, 4(sp)
	addi sp, sp, 4
	ret
#end_ss

PrintSpNoFucks:												# print sprite
	# Vamos achar a distancia do sprite ate o fim da tela: vamos tornar o enderco negativo e somar a largura da tela ate que o montante se torne positivo, que sera a distancia
		sub t1, x0, a3
		nf_finddist:
		addi t1, t1, 320
		blt t1, x0, nf_finddist	# t1 = distancia ate a extremidade direita da tela
	li t2, DISPbeg
	add a3, a3, t2				# a3 = endereco onde o sprite vai ser impresso
	li t2, 124					# t2 = cor do pixel invisivel
	
	li t5, 0					# t5 -> contador vertical
	li t6, 0					# t6 -> contador horizontal
	li t3, 320
	sub t3, t3, a1				# t3 = quantidade de pixels necessarios para descer uma linha

	nf_printsp_pixel:
		lb t0, 0(a0)				# pega o byte da RAM
		beq t0, t2, nf_invis_pixel		# ignora a cor invisivel (um verde ai)
		bge t6, t1, nf_overflow_pixel	# verifica se o contador e igual ou maior a distancia ate a borda direita --- indicando se o sprite ultrapassou o limite da tela
		sb t0, 0(a3)				# coloca o byte no endereco do buffer
	nf_invis_pixel:
		addi a0, a0, 1				# vai para o proximo byte da RAM
		addi a3, a3, 1				# vai para o proximo pixel do display
		addi t6, t6, 1				# incrementa o contador horizontal
		bne t6, a1, nf_printsp_pixel	# determina se continua na mesma linha
		
		add a3, a3, t3				# pula uma linha
		li t6, 0					# reseta o contador horizontal
		addi t5, t5, 1				# incrementa o contador vertical
		bne t5, a2, nf_printsp_pixel	# determina se ja printou todas as linhas
		li a0, 1
		ret

	nf_overflow_pixel:
		sub a0, a0, t6
		add a0, a0, a1
		sub a3, a3, t6
		addi a3, a3, 320
		li t6, 0					# reseta o contador horizontal
		addi t5, t5, 1				# incrementa o contador vertical
		bne t5, a2, nf_printsp_pixel	# determina se ja printou todas as linhas
		li a0, 1
		ret
#end_printsp

# Encontra uma raiz aproximada
# Antes:
# 	a0 = numero cuja raiz ha de se encontrar
# Depois:
# 	a0 = raiz aproximada
Sqrt:
	addi sp, sp, -8
	sw t0, 4(sp)
	sw t1, 8(sp)


	li t0, -1
	sqrt_loop:
	addi t0, t0, 1
	mul t1, t0, t0
	blt t1, a0, sqrt_loop
	mv a0, t0
	
	lw t0, 4(sp)
	lw t1, 8(sp)
	addi sp, sp, 8
	ret
#end_sqrt
